import logo from '../../logo.svg';
import './App.css';
import React from "react";
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Hosts from "../Hosts/hosts";
import BookingService from "../../repository/bookingRepository";
import Accommodations from "../Accommodations/AccommodationList/accommodations";
import Countries from "../Countries/countries";
import data from "bootstrap/js/src/dom/data";

class App extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            hosts : [],
            accommodations : [],
            countries : []

        }
    }



    componentDidMount() {
        this.loadHosts();
        this.loadCountries();
        this.loadAccommodations();
    }

    loadHosts = () => {
        BookingService.fetchHosts()
            .then((data) => {
                console.log(data.data)
                this.setState({
                    hosts: data.data,
                })
            })
    }

    loadAccommodations = () => {
        BookingService.fetchAccommodations()
            .then((data) => {
                console.log(data.data)
                this.setState({
                    accommodations: data.data
                })
            })
    }
    loadCountries = () => {
        BookingService.fetchCountries()
            .then((data) => {
                console.log(data.data)
                this.setState({
                    countries: data.data
                })
            })
    }


}

export default App;
